// SPDX-License-Identifier: MIT
pragma solidity ^0.4.2;

// Handles migrations whenever we deploy smart contracts to the blockchain
// When we push a smart contract onto the blockchain, we're migrating its state from one 
// state to the next (from not having it to having it). This is the same as changing state
// with a development database in a centralized application. Whenever we create another
// smart contract, we create a new file to handle migrating those smart contracts to the bc
contract Migrations {
  address public owner;
  uint public last_completed_migration;

  modifier restricted() {
    if (msg.sender == owner) _;
  }

  function Migrations() public {
    owner = msg.sender;
  }

  function setCompleted(uint completed) public restricted {
    last_completed_migration = completed;
  }

  function upgrade(address new_address) public restricted {
    Migrations upgraded = Migrations(new_address);
    upgraded.setCompleted(last_completed_migration);
  }
}
